response.about:
Лауреат конкурса «Музы Петербурга» г. Санкт-Петербург 2006 г.;

Лауреат 1-го Международного вокального конкурса «Поющая маска» г. Санкт-Петербург 2006 г.;

Лауреат всероссийского конкурса артистов эстрады «Эстрада 2006» г. Саратов;

Лауреат всероссийского конкурса артистов эстрады "Антре 2007" г. Санкт-Петербург;

Профессионально занимаюсь вокалом и танцем.

И мира нет — и нет нигде врагов;
Страшусь — надеюсь, стыну и пылаю;
В пыли влачусь — и в небесах витаю;
Всем в мире чужд — и мир обнять готов.

У ней в плену неволи я не знаю;
Мной не хотят владеть, а гнёт суров;
Амур не губит и не рвёт оков;
И жизни нет конца и мукам — краю.

Я зряч — без глаз; нем — вопли испускаю;
И жажду гибели — спасти молю;
Себе постыл — и всех других люблю;
Страданьем — жив; со смехом я — рыдаю;

И смерть и жизнь — с тоскою прокляты;
И этому виной, о донна, — ты!

